package com.syntax.class09;

public class PatternsPractice {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
//outer loop controls the rows and inner loop controls the columns 
	
		for(int a=1; a<5; a++) {
			for(int b=1; b<=5; b++) {
				System.out.print(b);
			}
			System.out.println();
		}
	}

}
